import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { v4 as uuidv4 } from "uuid";
import "./style.css";

const CreateGroupPage = ({ addGroup }) => {
  const [title, setTitle] = useState("");
  const [description, setDescription] = useState("");
  const [image, setImage] = useState(null); // 이미지 상태를 파일로 변경
  const [isPrivate, setIsPrivate] = useState(false);
  const [password, setPassword] = useState("");
  const navigate = useNavigate();

  const handleFileChange = (e) => {
    setImage(e.target.files[0]); // 선택된 파일을 상태에 저장
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    if (!title || !description || (isPrivate && !password)) {
      alert("모든 필드를 채워주세요.");
      return;
    }

    const newGroup = {
      id: uuidv4(),
      title,
      description,
      image: image ? URL.createObjectURL(image) : "", // 이미지 URL 생성
      isPrivate,
      password,
      createdAt: new Date(),
      likes: 0,
      memories: [],
      memoriesCount: 0,
      recommendations: 0,
    };

    addGroup(newGroup);
    navigate("/");
  };

  return (
    <div className="create-group-container">
      <h1 className="title">그룹 만들기</h1>
      <form onSubmit={handleSubmit} className="create-group-form">
        <div className="form-group">
          <label>그룹명</label>
          <input
            type="text"
            placeholder="그룹명을 입력해 주세요"
            value={title}
            onChange={(e) => setTitle(e.target.value)}
          />
        </div>
        <div className="form-group">
          <label>대표 이미지</label>
          <div className="file-input-container">
            <input
              type="file"
              onChange={handleFileChange} // 파일 선택 핸들러 연결
              className="file-input"
              style={{ display: "none" }} // 숨겨진 파일 입력 요소
            />
            <button
              type="button"
              className="file-select-button"
              onClick={() => document.querySelector(".file-input").click()}
            >
              파일 선택
            </button>
            {image && <p>{image.name}</p>} {/* 선택된 파일 이름을 표시 */}
          </div>
        </div>
        <div className="form-group">
          <label>그룹 소개</label>
          <textarea
            placeholder="그룹을 소개해 주세요"
            value={description}
            onChange={(e) => setDescription(e.target.value)}
          />
        </div>
        <div className="form-group">
          <label>그룹 공개 선택</label>
          <div className="toggle-container">
            <label className="toggle-label">
              공개
              <input
                type="checkbox"
                checked={!isPrivate}
                onChange={(e) => setIsPrivate(!e.target.checked)}
                className="toggle-input"
              />
              <span className="toggle-slider"></span>
            </label>
          </div>
        </div>
        {isPrivate && (
          <div className="form-group">
            <label>비밀번호</label>
            <input
              type="password"
              placeholder="비밀번호를 입력해 주세요"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
          </div>
        )}
        <button type="submit" className="submit-button">
          만들기
        </button>
      </form>
    </div>
  );
};

export default CreateGroupPage;
